// Footer.js

import React, { useState } from 'react';
import { SocialIcon } from 'react-social-icons';
import './Footer.css';

const Footer = () => {
  const [bgColorTwitter, setBgColorTwitter] = useState('grey'); // Twitter color
  const [bgColorInstagram, setBgColorInstagram] = useState('grey'); // Instagram color
  const [bgColorYouTube, setBgColorYouTube] = useState('grey'); // YouTube color
  const [bgColorFacebook, setBgColorFacebook] = useState('grey'); // Facebook color
  const [bgColorGitHub, setBgColorGitHub] = useState('grey'); // GitHub color

  const handleMouseEnterTwitter = () => {
    setBgColorTwitter('#17A1F2'); // Darker shade of Twitter color on mouse enter
  };

  const handleMouseLeaveTwitter = () => {
    setBgColorTwitter('#1DA1F2');
  };

  const handleMouseEnterInstagram = () => {
    setBgColorInstagram('#E1306C'); // Darker shade of Instagram color on mouse enter
  };

  const handleMouseLeaveInstagram = () => {
    setBgColorInstagram('#E4405F');
  };

  const handleMouseEnterYouTube = () => {
    setBgColorYouTube('#FF4500'); // Darker shade of YouTube color on mouse enter
  };

  const handleMouseLeaveYouTube = () => {
    setBgColorYouTube('#FF0000');
  };

  const handleMouseEnterFacebook = () => {
    setBgColorFacebook('#0D6EDB'); // Darker shade of Facebook color on mouse enter
  };

  const handleMouseLeaveFacebook = () => {
    setBgColorFacebook('#1877F2');
  };

  const handleMouseEnterGitHub = () => {
    setBgColorGitHub('#0D0D0D'); // Darker shade of GitHub color on mouse enter
  };

  const handleMouseLeaveGitHub = () => {
    setBgColorGitHub('#181717');
  };

  return (
    <footer className="footer">
      <div className="left-section">
        <p>&copy; 2024 Your Name</p>
      </div>
      <div className="right-section">
        <SocialIcon
          style={{ height: 40, width: 40, cursor: 'pointer', marginRight: '5px' }}
          className="custom-class"
          bgColor={bgColorTwitter}
          url="https://twitter.com/sajjdemon"
          target="_blank"
          onMouseEnter={handleMouseEnterTwitter}
          onMouseLeave={handleMouseLeaveTwitter}
        />
        <SocialIcon
          style={{ height: 40, width: 40, cursor: 'pointer', marginRight: '5px' }}
          className="custom-class"
          bgColor={bgColorInstagram}
          url="https://instagram.com/sajjdemon"
          target="_blank"
          onMouseEnter={handleMouseEnterInstagram}
          onMouseLeave={handleMouseLeaveInstagram}
        />
        <SocialIcon
          style={{ height: 40, width: 40, cursor: 'pointer', marginRight: '5px' }}
          className="custom-class"
          bgColor={bgColorYouTube}
          url="https://youtube.com/c/sajjdemon"
          target="_blank"
          onMouseEnter={handleMouseEnterYouTube}
          onMouseLeave={handleMouseLeaveYouTube}
        />
        <SocialIcon
          style={{ height: 40, width: 40, cursor: 'pointer', marginRight: '5px' }}
          className="custom-class"
          bgColor={bgColorFacebook}
          url="https://facebook.com/sajjaademon"
          target="_blank"
          onMouseEnter={handleMouseEnterFacebook}
          onMouseLeave={handleMouseLeaveFacebook}
        />
        <SocialIcon
          style={{ height: 40, width: 40, cursor: 'pointer' }}
          className="custom-class"
          bgColor={bgColorGitHub}
          url="https://github.com/ignite312"
          target="_blank"
          onMouseEnter={handleMouseEnterGitHub}
          onMouseLeave={handleMouseLeaveGitHub}
        />
      </div>
    </footer>
  );
};

export default Footer;
